import '../App.css';

class SearchBar extends Component {
  state = {
    input: ''
  };
  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <input onChange={this.handleChange} />

        <button type="button">hello</button>
      </form>
    );
  }
  handleChange = e => {};

  handleSubmit = e => {
    e.preventDefault();
    console.log(e);
  };
}

export default SearchBar;
